    return (
        <>
            <div class="flex h-auto">
                <div className="w-1/6 bg-gray-600 p-4 overflow-auto">
                    <ButtonsComponent currentButton={2} />
                </div>
                <div className="w-5/6 p-4 flex flex-col bg-gray-100 mx-auto px-4 py-6">
                    <h1 >Metode Tradiționale de Obținere a Culorilor</h1>
                    <h2>De-a lungul timpului oamenii au gasit diferite metode pentru a obtine pigmenti:</h2>
                    <h3>Preistorie și Antichitate</h3>
                   <ol>
                    <li><strong></strong></li>
                   </ol>
                  
                </div>
            </div>
        </>
    );
}
